import logo from './logo.svg';
import './App.css';
import Header from './Header/Headercomponent.js';
import Body from './Body/Bodycomponent.js';
import WeatherList from './WeatherComponents/WeatherList';
class App extends Component {

constructor(){
  super();
  this.state = {
    results : []
  }
}

componentDidMount(){
  this.getDataFromAPI();
}

  render() {
    return (
      <div className="App">
        <Header tekst="Overskrift :)"/> 
        <Body tekst="Her kommer vÃ¦ret"/>
        <WeatherList listOfWeather={this.state.results}/>
      </div>
    );
  }

  updateStates = (data) => {
    this.setState({
      results : data
    });
   }

  getDataFromAPI = () => {
    fetch('https://www.metaweather.com/api/location/search/?query=oslo')
    .then(res => res.json())
    .then(json => {
      console.log("Success");
      this.updateStates(json);
    });
  }



}

export default App;
